import React from "react";
import { connect } from "react-redux";
import { Redirect,NavLink } from "react-router-dom";
// import Order from "./Order";

import {
  Button,
  Card,
  Dimmer,
  Divider,
  Form,
  Grid,
  Header,
  Image,
  Label,
  Loader,
  Menu,
  Message,
  Segment,
  Select,
  Table
} from "semantic-ui-react";

import {
  countryListURL,
  addressListURL,
  addressCreateURL,
  addressUpdateURL,
  addressDeleteURL,
  userIDURL,
  endpoint

} from "../constants";
import { authAxios } from "../utils";
import axios from "axios";




class Dashboard extends React.Component {

  state = {
    loading: false,
    error: null,
    data: []
  };



componentDidMount() {
    this.setState({ loading: true });

      window.scrollTo(0, 0);



    axios
      .get(`${endpoint}/AccountsView/`)

      .then(res => {
        this.setState({ data: res.data.results, loading: false });
        window.scrollTo(0, 0);


      })
      .catch(err => {
        this.setState({ error: err, loading: false });
      });
  }



render() {
    const { data, error, loading } = this.state;


    window.scrollTo(0, 0);

    return (


        <div className='container'>
            <div className='row ' style ={{backgroundColor:"#FAFAFA"}}>



            <div className='col-md-12'>


                    <div className='row my-5'>

                        <div className='col-md-6 my-5'>
                            <br></br>
                              <div  style = {{borderRadius:'10px'}} class="list-group-item list-group-item-action" id="list-profile-list" data-bs-toggle="list"  role="tab" aria-controls="profile">
                                <img style={{display:'inline-block',width:'70px',height:'70px',marginTop:'-24px'}} src="https://lms10.s3.ap-southeast-1.amazonaws.com/skill-up/spoken-english/instructor.jpg" class="ui medium circular image"/>
                              <div style={{display:'inline-block',marginLeft:'10px',marginTop:'20px',marginBottom:'20px'}}>

                                  <h5 style={{marginLeft:'10px'}}> Munzereen Shahid</h5>
                                  <p style={{ marginLeft:'10px'}}> MS (English), University of Oxford (UK); </p>
                              </div>
                            </div>
                        </div>






















                    </div>



                </div>
            </div>


        </div>


    );
}
}


const mapStateToProps = state => {
  return {
    isAuthenticated: state.auth.token !== null
  };
};

export default connect(mapStateToProps)(Dashboard);
